import React from "react";
import "./AddObject.scss";

export default function AddObject({ page }) {

  const EmployeesFields = ["name", "field2"]
  const SprintsFields = ["name","field3"]
  const TasksFields = ["name", "project", "sprint"]
  const ProjectsFields = ["name"]

  const generateFields = () => {
    switch (page) {
      case "Employees":
        return <p>employee</p>
      case "Sprints":
        return <p>Sprint</p>
      case "Tasks":
        return <p>Task</p>
      case "Projects":
        return <p>project</p>
    }
  }

  return (
    <div className="addObjPage">

      {generateFields()}
    </div>
  );
}
